import React, { useState } from 'react';

const Seats = () => {

    const [seatsMarked, SetSeatMarked] = useState([]);
    const [update, SetUpdate] = useState(false);

    const seatClicked = (target) => {
        const id = target.id
        if (seatsMarked.includes(id)) {
            for( var i = 0; i < seatsMarked.length; i++){ 
                if ( seatsMarked[i] === id) { 
                    seatsMarked.splice(i, 1); 
                }
            }
            target.fill = '#4F4F4F';
        } else {
            seatsMarked.push(id);
            target.fill = 'green';
        }
        document.getElementById(target.id).style.fill = target.fill
        SetUpdate(!update);
    }

    return (
        <div>
            <p>Seats chosen: {seatsMarked.map(x => x.substring(4) + ' ')}</p>
            <SeatsSvg clickOnSeat={seatClicked} />
        </div>
    );
}

